import { Calendar } from '@fullcalendar/core';
import googleCalendarPlugin from '@fullcalendar/google-calendar';

const PlanningComp = () =>{
let calendar = new Calendar(calendarEl, {
  plugins: [ googleCalendarPlugin ],
  googleCalendarApiKey: 'AIzaSyCIc-9Qw-Ime5dg4ADN5kCpgY-hbPkBwKQ',
  events: {
    googleCalendarId: 'https://calendar.google.com/calendar/embed?src=arnaud.meilhoc92%40gmail.com&ctz=Europe%2FParis'
  }
});
}

export default PlanningComp;
